import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav>
      <ul>
        <li>
          <Link t>About</Link>
        </li>
        <li>
          <a href="#">Features</a>
        </li>
        <li>
          <a href="#">Safety</a>
        </li>
        <li>
          <a href="#">Compatibility</a>
        </li>
      </ul>
    </nav>
  );
}

export default Navbar;
